CREATE TABLE public.feira_livre (
	id text NOT NULL DEFAULT gen_random_uuid(),
	longi int8 NULL,
	lat int8 NULL,
	setcens int8 NULL,
	areap int8 NULL,
	coddist int8 NULL,
	distrito text NULL,
	codsubpref int8 NULL,
	subprefe text NULL,
	regiao5 text NULL,
	regiao8 text NULL,
	nome_feira text NULL,
	registro text NULL,
	logradouro text NULL,
	numero text NULL,
	bairro text NULL,
	referencia text NULL,
	CONSTRAINT feira_livre_pkey PRIMARY KEY (id)
);
CREATE INDEX idx_feira_livre_id ON public.feira_livre USING btree (id);

